import React from 'react';
import logo from './logo.svg';
import iphone from './ressources/iphonex.png';
import arrowLeft from './ressources/arrow-left-circle.svg';

import './App.css';
import Navbar from './Navbar';



export default class ProductPage extends React.Component{
    render(){
        return(
            <div>
                <div><Navbar/></div>
                <div id="frame">
                    <div class="border border-2 rounded-1" id="photo-frame">
                        <div>
                            <img src={arrowLeft}></img>
                            <img src={iphone} id="photo"></img>
                            
                        </div>
                        <div>
                            <p>A very great mobile phone.</p>
                        </div>
                        <div id="left-arrow">
                            
                        </div>
                        <div id="right-arrow">
                        
                        </div>
                       
                    </div>
                    <div class="border border-2 rounded-1" id="photo-frame2">
                    </div>
                </div>
                
            </div>
        )
    }
}
